import { Link } from "react-router-dom";
import MainNavigation from "../components/MainNavigation";

function HomePage() {
  return (
    <>
      <MainNavigation />
      <h1>홈페이지</h1>
      <p>
        <Link to="/product">프로덕트로</Link>
      </p>
    </>
  );
}

export default HomePage;
